import React, { useEffect } from "react";



function Tasks() {
    const opts = {
        headers: {
            'Authorization': 'Bearer' },
    };
  useEffect(() => 
  {
    fetch("/tasks", opts).then((response) =>
      response.json().then((data) => {
        console.log(data);
      })
    );
  }, []);
  return <div>Tasks</div>;
}

export default Tasks;
